// 1576143863
// 1576145006976
function CheckTimeOut(input) {
    if (input === 0) {
        return false
    }
    console.log("timeout", new Date(Date.now()))
    input = parseInt(input) * 1000
    console.log("timeout", new Date(input))
    return new Date(input)
}


export { CheckTimeOut }
